export class MapleWarrior extends Buff {
  name = 'Maple Warrior'
  icon = ''
  order = 0
  tips = 'If you use (Decent) Combat Order, choose another version of Maple Warrior'
  apply = (init: StatsDetail) => {
    return {
      ...init,
      addedDex: Math.floor(init.pureDex * 0.15),
      addedStr: Math.floor(init.pureStr * 0.15),
      addedInt: Math.floor(init.pureInt * 0.15),
      addedLuk: Math.floor(init.pureLuk * 0.15),
    }
  }
}

